(1,14,'en','TOYOTA VITZ','<div class=\"flex max-w-full flex-col flex-grow\">\n<div class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\n<div class=\"markdown prose w-full break-words dark:prose-invert dark\">\n<p>Experience the perfect blend of style and efficiency with our 2017 Toyota Vitz for rent! This compact hatchback is ideal for city driving, offering a smooth ride, excellent fuel economy, and easy maneuverability. With its modern design, comfortable interior, and advanced safety features, the Vitz ensures a pleasant driving experience. Whether you’re exploring urban hotspots or heading out on a weekend adventure, this reliable car will get you there with ease. Book now for a convenient and enjoyable rental experience!</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"mb-2 flex gap-3 empty:hidden -ml-2\">\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\n<div class=\"flex items-center\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"></button>\n<div class=\"flex items-center pb-0\"><span class=\"overflow-hidden text-clip whitespace-nowrap text-sm\">4o mini</span></div>\n</div>\n</div>\n</div>',NULL,'DIani Beach Road',9,9,NULL,'2024-10-02 07:00:03','2024-10-02 09:50:57',NULL);
INSERT INTO `bravo_cars` VALUES
(1,'BMW-X6-facelift','bmw-x6-facelift','<p>Libero sem vitae sed donec conubia integer nisi integer rhoncus imperdiet orci odio libero est integer a integer tincidunt sollicitudin blandit fusce nibh leo vulputate lobortis egestas dapibus faucibus metus conubia maecenas cras potenti cum hac arcu rhoncus nullam eros dictum torquent integer cursus bibendum sem sociis molestie tellus purus</p><p>Quam fusce convallis ipsum malesuada amet velit aliquam urna nullam vehicula fermentum id morbi dis magnis porta sagittis euismod etiam</p><h4>HIGHLIGHTS</h4><ul><li>Visit the Museum of Modern Art in Manhattan</li><li>See amazing works of contemporary art, including Vincent van Gogh\'s The Starry Night</li><li>Check out Campbell\'s Soup Cans by Warhol and The Dance (I) by Matisse</li><li>Behold masterpieces by Gauguin, Dali, Picasso, and Pollock</li><li>Enjoy free audio guides available in English, French, German, Italian, Spanish, Portuguese</li></ul>',142,135,1,'Arrondissement de Paris','21.054831','105.796077',12,0,'154,155,156,157,158,159,160','https://www.youtube.com/watch?v=UfEiKK-iX70','[{\"title\":\"When should I check the transmission fluid?\",\"content\":\"You should check the transmission fluid regularly. Try to check it at least once a month or at the sign of any trouble, for instance if there is any hesitation when you shift gears in an automatic.\"},{\"title\":\"How do I check the transmission fluid?\",\"content\":\"It\\u2019s not hard to check your transmission fluid if the vehicle is an automatic. This link to the Dummies guide to checking your transmission fluid has step-by-step instructions and illustrations that show you where to locate the dipstick. What you want is clear, pink transmission fluid. If it is low, top it up. If it is dark, smells burnt or has bits in it then you need to get it changed by at a reliable auto repair shop.\"},{\"title\":\"Is it really that important to check the transmission fluid?\",\"content\":\"Yes, it can be. Often times the symptoms you\\u2019ll experience from low or dirty transmission fluid will be the same as transmission problems. If you check the fluid levels regularly and refill as necessary then you\\u2019ll know if there are any symptoms of trouble that it\\u2019s not because the fluid levels are low and you need to see a mechanic.\"},{\"title\":\"Are there different types of transmission fluid?\",\"content\":\"How do I know what to buy? Yes, there are many different types of transmission fluid, each designed for a certain transmission. Different vehicles require different transmission fluids and the age of the car can also be a factor because newer transmissions take different types of transmission fluids than older vehicles. Don\\u2019t guess! Find out which type of transmission fluid is required for your vehicle by checking your owner\\u2019s manual.\"},{\"title\":\"What is a transmission flush and should I get one?\",\"content\":\"A transmission flush is used by some auto repair shops with the goal of flushing out debris.  Auto Tech does not do any sort of transmission flush.  Flushing an older transmission can cause harmful sediment to get stuck in the solenoids of the transmission. We heavily favor regular maintenance to lengthen the life of your transmission.  We service the transmission by changing fluid and the filter and do not recommend having your transmission flushed.\"},{\"title\":\"How do I know I have a fluid leak from the transmission?\",\"content\":\"Transmission fluid is slightly pink in color \\u2013 it will appear pink or red, or possibly more brownish if the transmission fluid is dirty and needs to be replaced. When you feel transmission fluid it will be slick and oily on your fingers. It smells much like oil unless it is dirty, in which case it will smell burnt. Usually transmission fluid leaks around the front or middle of your vehicle, so if you find puddles of reddish liquid there it is probably transmission fluid. Another clue is if in addition to the leak your transmission is not working well and you notice changes in the way it sounds when you shift gears, or if shifting gears is not working as well. In this case you likely have a leak of transmission fluid that is impacting how your transmission operates.\"}]',5,500.00,136.00,0,1,'[{\"name\":\"Child Toddler Seat\",\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Infant Child Seat\",\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"GPS Satellite\",\"price\":\"200\",\"type\":\"one_time\"}]',NULL,10,'Auto',4,4,'publish',1,9,9,'2024-10-01 17:32:21','2024-09-13 09:21:07','2024-10-02 11:19:07',0.0,NULL,NULL,'[{\"name\":\"Make\",\"desc\":\"Honda\"},{\"name\":\"Model\",\"desc\":\"Class C\"},{\"name\":\"Made Year\",\"desc\":\"2019\"},{\"name\":\"Mileage\",\"desc\":\"120,556\"},{\"name\":\"VIN\",\"desc\":\"KLJLKJLKJFDF1\"},{\"name\":\"Version\",\"desc\":\"2.0 Turbo\"},{\"name\":\"Horsepower (hp)\",\"desc\":\"200\"},{\"name\":\"Transmission\",\"desc\":\"Auto\"},{\"name\":\"Condition\",\"desc\":\"New\"},{\"name\":\"Drive\",\"desc\":\"Rear\"},{\"name\":\"Warranty\",\"desc\":\"Yes\"}]',1,NULL,NULL,NULL),
