(238,7,'space','Nice Cottage','Me and my girls loved our stay. Great services from Harmo Stays.',5,'41.90.32.58','approved',NULL,13,9,NULL,NULL,'2024-10-03 16:47:07','2024-10-03 16:48:44',9,13),
(239,17,'space','Manuastro Villa Is the ideal Gateway🏡','I recently stayed at Manuastro Villas with my family, it\'s just 5 mins from the Beach, and it was an incredible experience! The villa is private, beautifully furnished with good outdoor furniture\'s offering ample space and comfort for my fam. Downstairs bedrooms had air conditioning, which made our stay even more enjoyable during the warm days. \r\n\r\nThe outdoor area was a highlight, featuring a lovely garden and a private pool that provided a perfect oasis for relaxation. We loved being so close to the beach, allowing us to easily enjoy the sun and surf. The villa’s location also made it convenient to explore local shops and restaurants. \r\n\r\nHarmo Stays and Astony the Host were quite welcoming, ensuring we had everything we needed for a memorable stay.',5,'41.90.32.58','pending',NULL,17,NULL,NULL,NULL,'2024-10-03 17:05:25','2024-10-03 17:05:25',9,17);
