(6,17,'en','Manuastro Villa Diani Beach','<div class=\"flex max-w-full flex-col flex-grow\">\n<div class=\"min-h-[20px] text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\n<p>Escape to our stunning<strong> 3-bedroom private villa</strong> at Diani Beach, where luxury meets tranquility. Nestled amidst lush tropical gardens, the villa features an <strong>inviting pool</strong> surrounded by sun loungers, perfect for relaxation. Each bedroom <strong>offers comfort and elegance</strong>, with the master suite boasting an en-suite bathroom. Step out onto the spacious balcony to soak in breathtaking views of the azure ocean and swaying palm trees, making it the ideal spot for morning coffee or sunset cocktails. Experience the ultimate <strong>beach getaway</strong> in this serene oasis!</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"mb-2 flex gap-3 empty:hidden -ml-2\">\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\n<div class=\"flex items-center\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"></button>\n<div class=\"flex items-center pb-0\"><span class=\"overflow-hidden text-clip whitespace-nowrap text-sm\">4o mini</span></div>\n</div>\n</div>\n</div>','[{\"title\":\"Check-in time?\",\"content\":\"As a rough guide, the check-in time is after 12 a.m. Let us know your arrival time in case you schedule and early check in we\\u2018ll do our best to have your room available.\"},{\"title\":\"Check-out time?\",\"content\":\"The check-out time is before 12pm. If you plan a late check out kindly let us know your departure time, we\\u2019ll our best to satisfy your needs.\"},{\"title\":\"Can I leave my luggage?\",\"content\":\"Yes, we can look after your luggage. If at check in your room is not ready yet or in case of early check out after .We will store your luggage free of charge on your check-in and check-out days.\"},{\"title\":\"Is there WIFI?\",\"content\":\"A wireless internet connection is available throughout the villa.\\r\\n\\r\\nThe guest rooms feature hi-speed WIFI connectivity.\"}]','Along Diani Beach Rd at Coconut Groove',9,9,NULL,'2024-09-23 15:21:22','2024-09-24 10:03:52','{\"1\":[{\"name\":\"The Sandy Beach\",\"content\":\"The villa is 5 minutes walk from the beach.\",\"value\":\"300\",\"type\":\"m\"},{\"name\":\"Diani Beach Road\",\"content\":\"The villa is located in a gated community just by the roadside.\",\"value\":\"50\",\"type\":\"m\"}],\"3\":[{\"name\":null,\"content\":null,\"value\":null,\"type\":\"m\"}]}'),
(7,1,'en','Golden Sands Beach Apartments','<div class=\"flex max-w-full flex-col flex-grow\">\n<div class=\"min-h-[20px] text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\n<p>Experience the ultimate beachfront getaway in our luxury studio apartments at Diani Beach, Kenya. Nestled among lush tropical gardens and just steps away from the pristine white sands, these elegantly designed studios blend modern comfort with coastal charm.</p>\n<p>Each apartment features a spacious layout, showcasing contemporary furnishings, a fully equipped kitchenette, and a stylish en-suite bathroom. Large windows flood the space with natural light and offer stunning views of the Indian Ocean or the vibrant gardens.</p>\n<p>Indulge in the convenience of high-end amenities, including air conditioning, complimentary Wi-Fi, and flat-screen TVs. Step outside to discover your private terrace or balcony, perfect for sipping morning coffee or enjoying evening sunsets.</p>\n<p>With direct access to the beach, you can spend your days lounging in the sun, engaging in water sports, or exploring nearby attractions. On-site, unwind in our infinity pool, savor gourmet meals at the restaurant, or rejuvenate at the spa.</p>\n<p>Whether you\'re seeking a romantic escape or a solo retreat, our luxury studio apartments at Diani Beach promise an unforgettable experience in paradise.</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"mb-2 flex gap-3 empty:hidden -ml-2\">\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\n<div class=\"flex items-center\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"></button>\n<div class=\"flex items-center pb-0\"><span class=\"overflow-hidden text-clip whitespace-nowrap text-sm\">4o mini</span></div>\n</div>\n</div>\n</div>','{\"0\":{\"title\":\"Check-in time?\",\"content\":\"As a rough guide, the check-in time is after 12 p.m. Let us know your arrival time in case you schedule and early check in we\\u2018ll do our best to have your room available.\"},\"1\":{\"title\":\"Check-out time?\",\"content\":\"As a rough guide, the check-out time is before 11am. If you plan a late check out kindly let us know your departure time, we\\u2019ll our best to satisfy your needs.\"},\"4\":{\"title\":\"Can I leave my luggage?\",\"content\":\"Yes, we can look after your luggage. If at check in your room is not ready yet or in case of early check out after .We will store your luggage free of charge on your check-in and check-out days.\"},\"5\":{\"title\":\"Internet connection?\",\"content\":\"A wireless internet connection is available throughout the property.\\r\\n\\r\\nThe guest rooms feature hi-speed web connectivity (both wireless and cabled).\"}}','Diani Beach Road',9,9,NULL,'2024-09-23 17:42:47','2024-10-02 07:42:58',NULL),
(8,2,'en','LUXURY APARTMENT','<p>Libero sem vitae sed donec conubia integer nisi integer rhoncus imperdiet orci odio libero est integer a integer tincidunt sollicitudin blandit fusce nibh leo vulputate lobortis egestas dapibus faucibus metus conubia maecenas cras potenti cum hac arcu rhoncus nullam eros dictum torquent integer cursus bibendum sem sociis molestie tellus purus</p>\n<p>Quam fusce convallis ipsum malesuada amet velit aliquam urna nullam vehicula fermentum id morbi dis magnis porta sagittis euismod etiam</p>\n<h4>HIGHLIGHTS</h4>\n<ul>\n<li>Visit the Museum of Modern Art in Manhattan</li>\n<li>See amazing works of contemporary art, including Vincent van Gogh\'s The Starry Night</li>\n<li>Check out Campbell\'s Soup Cans by Warhol and The Dance (I) by Matisse</li>\n<li>Behold masterpieces by Gauguin, Dali, Picasso, and Pollock</li>\n<li>Enjoy free audio guides available in English, French, German, Italian, Spanish, Portuguese</li>\n</ul>','[{\"title\":\"Check-in time?\",\"content\":\"As a rough guide, the check-in time is after 12 a.m. Let us know your arrival time in case you schedule and early check in we\\u2018ll do our best to have your room available.\"},{\"title\":\"Check-out time?\",\"content\":\"As a rough guide, the check-out time is before 12pm. If you plan a late check out kindly let us know your departure time, we\\u2019ll our best to satisfy your needs.\"},{\"title\":\"Is Reception open 24 hours?\",\"content\":\"Yes, Reception service is available 24 hours.\"},{\"title\":\"Which languages are spoken at Reception?\",\"content\":\"Italian, English, French, German and Spanish.\"},{\"title\":\"Can I leave my luggage?\",\"content\":\"Yes, we can look after your luggage. If at check in your room is not ready yet or in case of early check out after .We will store your luggage free of charge on your check-in and check-out days.\"},{\"title\":\"Internet connection?\",\"content\":\"A wireless internet connection is available throughout the hotel.\\r\\n\\r\\nThe guest rooms feature hi-speed web connectivity (both wireless and cabled).\"}]','Porte de Vanves',9,6,NULL,'2024-09-24 20:38:29','2024-10-01 16:47:54',NULL),
(9,11,'en','GREENWICH VILLAGE NYALI','<p><strong>Charming Cottage at Nyali Beach</strong></p>\n<p>Nestled among swaying palm trees and just steps from the pristine white sands of Diani Beach, this cozy cottage offers the perfect tropical getaway. With a blend of rustic charm and modern comforts, the cottage features a spacious open-plan living area adorned with local artwork, a fully equipped kitchenette, and large windows that fill the space with natural light.</p>\n<p>Step outside onto your private terrace, where you can enjoy morning coffee while listening to the gentle waves or unwind in the evening with a cocktail as the sun sets over the Indian Ocean. The lush garden surrounding the cottage is ideal for leisurely strolls or simply relaxing in a hammock.</p>\n<p>Conveniently located near vibrant beachside cafes, local markets, and exciting water sports, this cottage is perfect for both adventure seekers and those looking to unwind. Experience the tranquility of Diani Beach in a charming setting that feels like a home away from home.</p>','[{\"title\":\"Check-in time?\",\"content\":\"As a rough guide, the check-in time is after 12 a.m. Let us know your arrival time in case you schedule and early check in we\\u2018ll do our best to have your room available.\"},{\"title\":\"Check-out time?\",\"content\":\"As a rough guide, the check-out time is before 12pm. If you plan a late check out kindly let us know your departure time, we\\u2019ll our best to satisfy your needs.\"},{\"title\":\"Is Reception open 24 hours?\",\"content\":\"Yes, Reception service is available 24 hours.\"},{\"title\":\"Which languages are spoken at Reception?\",\"content\":\"English, French, German, Italian, Spanish. and Swahili.\"},{\"title\":\"Can I leave my luggage?\",\"content\":\"Yes, we can look after your luggage. If at check in your room is not ready yet or in case of early check out after .We will store your luggage free of charge on your check-in and check-out days.\"},{\"title\":\"Internet connection?\",\"content\":\"A wireless internet connection is available throughout the hotel.\\r\\n\\r\\nThe guest rooms feature hi-speed web connectivity (both wireless and cabled).\"}]','Along Links Road 3rd Avenue',9,9,NULL,'2024-09-24 20:44:39','2024-10-01 17:11:33',NULL),
(10,10,'en','LILY DALE COTTAGE','<p>Nestled among swaying palm trees and just steps from the pristine white sands of Malindi Beach, this cozy cottage offers the perfect tropical getaway. With a blend of rustic charm and modern comforts, the cottage features a spacious open-plan living area adorned with local artwork, a fully equipped kitchenette, and large windows that fill the space with natural light.</p>\n<p>Step outside onto your private terrace, where you can enjoy morning coffee while listening to the gentle waves or unwind in the evening with a cocktail as the sun sets over the Indian Ocean. The lush garden surrounding the cottage is ideal for leisurely strolls or simply relaxing in a hammock.</p>\n<p>Conveniently located near vibrant beachside cafes, local markets, and exciting water sports, this cottage is perfect for both adventure seekers and those looking to unwind. Experience the tranquility of Diani Beach in a charming setting that feels like a home away from home.</p>','[{\"title\":\"Check-in time?\",\"content\":\"As a rough guide, the check-in time is after 12 a.m. Let us know your arrival time in case you schedule and early check in we\\u2018ll do our best to have your room available.\"},{\"title\":\"Check-out time?\",\"content\":\"As a rough guide, the check-out time is before 12pm. If you plan a late check out kindly let us know your departure time, we\\u2019ll our best to satisfy your needs.\"},{\"title\":\"Is Reception open 24 hours?\",\"content\":\"Yes, Reception service is available 24 hours.\"},{\"title\":\"Which languages are spoken at Reception?\",\"content\":\"Italian, English, French, German and Spanish.\"},{\"title\":\"Can I leave my luggage?\",\"content\":\"Yes, we can look after your luggage. If at check in your room is not ready yet or in case of early check out after .We will store your luggage free of charge on your check-in and check-out days.\"},{\"title\":\"Internet connection?\",\"content\":\"A wireless internet connection is available throughout the hotel.\\r\\n\\r\\nThe guest rooms feature hi-speed web connectivity (both wireless and cabled).\"}]',NULL,9,9,NULL,'2024-09-24 20:56:44','2024-10-01 17:30:27',NULL),
