(21,22,'en','Beachfront Apartment at Nyali','<div class=\"flex max-w-full flex-col flex-grow\">\n<div class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\n<div class=\"markdown prose w-full break-words dark:prose-invert dark\">\n<p>Welcome to your paradise retreat at our stunning 3-bedroom beachfront apartment in Nyali! This spacious and elegantly designed apartment offers breathtaking ocean views and direct access to the sandy shores. With three beautifully appointed bedrooms, it comfortably accommodates families or groups seeking relaxation and adventure. Enjoy the open-concept living and dining area that seamlessly flows to a private balcony, perfect for sunset views.</p>\n<p>The apartment features a modern kitchen equipped with everything you need for home-cooked meals. Step outside to discover a sparkling swimming pool surrounded by lush gardens, ideal for sunbathing or enjoying a refreshing dip. Located just moments from local attractions, dining, and shopping, this beachfront haven is the perfect blend of comfort and convenience. Experience the ultimate coastal lifestyle at this Nyali gem!</p>\n</div>\n</div>\n</div>\n</div>\n<div class=\"mb-2 flex gap-3 empty:hidden -ml-2\">\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\n<div class=\"flex items-center\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"></button>\n<div class=\"flex items-center pb-0\"><span class=\"overflow-hidden text-clip whitespace-nowrap text-sm\">4o mini</span></div>\n</div>\n</div>\n</div>','[{\"title\":\"Check-in time?\",\"content\":\"As a rough guide, the check-in time is after 12pm. Let us know your arrival time in case you schedule and early check in we\\u2018ll do our best to have your room available.\"},{\"title\":\"Check-out time?\",\"content\":\"As a rough guide, the check-ou