(22,23,'en','Luxury Apartment at Kileleshwa','<p>Welcome to your cozy retreat in Kileleshwa, Nairobi! This fully furnished one-bedroom apartment is designed for comfort and convenience, featuring a charming balcony where you can relax and enjoy the fresh air. Enjoy modern amenities, including a hot shower for those refreshing moments after a long day.</p>\n<p>This spacious house features a well-equipped kitchen, perfect for culinary enthusiasts and family gatherings. Enjoy movie nights on the smart TV and stay connected with high-speed Wi-Fi throughout the property.</p>\n<p>With self check-in for hassle-free access, this apartment allows you to come and go as you please. Stay active in the functional gym on-site, perfect for maintaining your fitness routine. Located just moments away from a variety of beautiful malls, you\'ll have easy access to shopping, dining, and entertainment options. Whether you’re here for business or leisure, this Kileleshwa gem is the ideal home away from home!</p>\n<div class=\"flex max-w-full flex-col flex-grow\">\n<div class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\n<div class=\"markdown prose w-full break-words dark:prose-invert dark\">\n<p>For added convenience, the house includes a lift, making accessibility a breeze. Ample parking ensures you and your guests have plenty of space, while 24/7 security provides peace of mind for a safe and comfortable living experience. Whether you\'re entertaining or relaxing, this home offers everything you need for modern living. Experience comfort and convenience all in one place!</p>\n<div class=\"flex max-w-full flex-col flex-grow\">\n<div class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\n<div class=\"markdown prose w-full break-words dark:prose-invert dark\">\n<h3><strong>Cancellation Policy</strong></h3>\n<p>We want you to feel secure in your booking! Our moderate cancellation policy allows for a full refund if you cancel your reservation up to 5 days before your check-in date.</p>\n<p>Please note that cancellations made within 5 days of check-in will not be eligible for a refund. We encourage you to plan accordingly and reach out if you have any questions about your reservation. Thank you for understanding, and we look forward to welcoming you!</p>\n<p> </p>\n</div>\n</div>\n</div>\n</div>\n<h3><strong>Apartment Guidelines for a Comfortable Stay</strong></h3>\n<p>Welcome to your home away from home! To ensure a pleasant experience for everyone, please adhere to the following guidelines:</p>\n<ol>\n<li>\n<p><strong>Responsibility for Damages</strong>: If any valuable items in the apartment are found missing or broken during or after your stay, you will be responsible for covering the replacement costs.</p>\n</li>\n<li>\n<p><strong>No Smoking</strong>: Smoking is not permitted in the apartment. Please respect this rule for the comfort of all guests.</p>\n</li>\n<li>\n<p><strong>Lost Keys</strong>: In the event of lost apartment keys, a replacement fee of 5,000 KES will be charged.</p>\n</li>\n<li>\n<p><strong>Respect the Stay</strong>: Treat the apartment as if it were your own. Your consideration contributes to a welcoming environment.</p>\n</li>\n<li>\n<p><strong>Neighborly Conduct</strong>: Use common sense and be respectful to your neighbors. A peaceful atmosphere benefits everyone.</p>\n</li>\n<li>\n<p><strong>Trash Disposal</strong>: Please take all trash to the trash room located next to the guard room before checking out.</p>\n</li>\n<li>\n<p><strong>Electricity for Long-Term Stays</strong>: For stays longer than one month, guests are responsible for recharging electricity and purchasing tokens as needed.</p>\n</li>\n<li>\n<p><strong>Shoe Cleaning</strong>: A brush is provided for wiping or cleaning shoes. Please refrain from using towels for this purpose.</p>\n</li>\n<li>\n<p><strong>Open Communication</strong>: If anything arises that we should know about, feel free to come and share. You are also welcome to ask us any questions or seek assistance during your stay.</p>\n</li>\n</ol>\n<p>Thank you for your cooperation and enjoy your stay!</p>\n<p> </p>\n<p><strong>Gallery</strong></p>\n<p>Living Room</p>\n<p> </p>\n<p><img src=\"/uploads/0000/9/2024/10/03/living-room-6.jpeg\" alt=\"Living Room\" width=\"251\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/living-room-4.jpeg\" alt=\"Living Room\" width=\"251\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/living-room-2.jpeg\" alt=\"\" width=\"251\" height=\"445\" /></p>\n<p>Kitchen</p>\n<p><img src=\"/uploads/0000/9/2024/10/03/kitchen.png\" alt=\"Kitchen\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/kitchen-2.png\" alt=\"Kitchen\" width=\"267\" height=\"445\" /></p>\n<p>Bedroom</p>\n<p><img src=\"/uploads/0000/9/2024/10/03/bedroom.png\" alt=\"Bedroom\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/bedroom-2.png\" alt=\"Bedroom\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/bedroom-3.png\" alt=\"\" width=\"267\" height=\"445\" /></p>\n<p>Washroom</p>\n<p><img src=\"/uploads/0000/9/2024/10/03/washroom.png\" alt=\"Washroom\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/washroom-2.png\" alt=\"Washroom\" width=\"267\" height=\"445\" /></p>\n<p>Functional Gym</p>\n<p><img src=\"/uploads/0000/9/2024/10/03/gym-2.png\" alt=\"Gym\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/gym-3.png\" alt=\"Gym\" width=\"267\" height=\"445\" /></p>\n<p>Exterior</p>\n<p><img src=\"/uploads/0000/9/2024/10/03/exterior.png\" alt=\"Exterior View\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/exterior-3.png\" alt=\"Night Exterior View\" width=\"267\" height=\"445\" /></p>\n</div>\n</div>\n</div>\n</div>','[{\"title\":\"Check-in time?\",\"content\":\"Our standard check-in time is after 12pm. If you plan to arrive earlier, please let us know your expected arrival time. We\\u2019ll do our best to accommodate your request for an early check-in and have your room ready for you. Your comfort is our priority, and we look forward to welcoming you!\"},{\"title\":\"Check-out time?\",\"content\":\"Check-out time is before 10am. If you anticipate needing a late check-out, please let us know your departure time. We\\u2019ll do our best to accommodate your request and ensure your needs are met. Thank you for your understanding, and we hope you have a wonderful stay!\"},{\"title\":\"Internet Access?\",\"content\":\"Enjoy seamless connectivity during your stay! A wireless internet connection is available throughout the property, and the bedroom features high-speed web access, wirelessly.. Stay connected for work or leisure with ease!\"}]','At Gatundu Heights along Gatundu Close, Kileleshwa Nairobi.',9,9,NULL,'2024-10-03 10:28:27','2024-10-03 13:26:50',NULL);
