(1,'Golden Sands Beach Apartments','luxury-studio','<div class=\"flex max-w-full flex-col flex-grow\">\r\n<div class=\"min-h-[20px] text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\r\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n<p>Experience the ultimate beachfront getaway in our luxury studio apartments at Diani Beach, Kenya. Nestled among lush tropical gardens and just steps away from the pristine white sands, these elegantly designed studios blend modern comfort with coastal charm.</p>\r\n<p>Each apartment features a spacious layout, showcasing contemporary furnishings, a fully equipped kitchenette, and a stylish en-suite bathroom. Large windows flood the space with natural light and offer stunning views of the Indian Ocean or the vibrant gardens.</p>\r\n<p>Indulge in the convenience of high-end amenities, including air conditioning, complimentary Wi-Fi, and flat-screen TVs. Step outside to discover your private terrace or balcony, perfect for sipping morning coffee or enjoying evening sunsets.</p>\r\n<p>With direct access to the beach, you can spend your days lounging in the sun, engaging in water sports, or exploring nearby attractions. On-site, unwind in our infinity pool, savor gourmet meals at the restaurant, or rejuvenate at the spa.</p>\r\n<p>Whether you\'re seeking a romantic escape or a solo retreat, our luxury studio apartments at Diani Beach promise an unforgettable experience in paradise.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mb-2 flex gap-3 empty:hidden -ml-2\">\r\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\r\n<div class=\"flex items-center\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"></button>\r\n<div class=\"flex items-center pb-0\"><span class=\"overflow-hidden text-clip whitespace-nowrap text-sm\">4o mini</span></div>\r\n</div>\r\n</div>\r\n</div>',397,398,15,'Diani Beach Road','-4.247018088372481','39.614687075018765',15,1,'398,402,392,391,',NULL,'{\"0\":{\"title\":\"Check-in time?\",\"content\":\"As a rough guide, the check-in time is after 12 p.m. Let us know your arrival time in case you schedule and early check in we\\u2018ll do our best to have your room available.\"},\"1\":{\"title\":\"Check-out time?\",\"content\":\"As a rough guide, the check-out time is before 11am. If you plan a late check out kindly let us know your departure time, we\\u2019ll our best to satisfy your needs.\"},\"4\":{\"title\":\"Can I leave my luggage?\",\"content\":\"Yes, we can look after your luggage. If at check in your room is not ready yet or in case of early check out after .We will store your luggage free of charge on your check-in and check-out days.\"},\"5\":{\"title\":\"Internet connection?\",\"content\":\"A wireless internet connection is available throughout the property.\\r\\n\\r\\nThe guest rooms feature hi-speed web connectivity (both wireless and cabled).\"}}',6500.00,7500.00,1,0,0,2,1,1,30,1,'[{\"name\":\"SGR Shuttle Pickup\",\"price\":\"700.00\",\"type\":\"one_time\",\"per_person\":\"on\"},{\"name\":\"SGR Shuttle Droppoff\",\"price\":\"700.00\",\"type\":\"one_time\",\"per_person\":\"on\"},{\"name\":\"Airport  Pickup\",\"price\":\"5000.00\",\"type\":\"one_time\"},{\"name\":\"Airport Dropoff\",\"price\":\"5000.00\",\"type\":\"one_time\"}]',NULL,'publish',1,1,9,NULL,'2024-09-13 09:20:42','2024-10-02 11:19:39',0.0,NULL,NULL,NULL,NULL,9,1,1),
