(20,'Bustani Studio Apts','bustani-studio-apts','<div class=\"flex max-w-full flex-col flex-grow\">\r\n<div class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\r\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert dark\">\r\n<p>Discover your perfect coastal escape at Bustani, Nyali! This stylish studio apartment offers a blend of comfort and convenience, ideal for solo travelers or couples. With a bright and airy layout, the space features modern furnishings, a cozy sleeping area, and a well-equipped kitchenette. Enjoy the serene garden views from your private balcony, and take advantage of the nearby beach, shops, and restaurants. Embrace the vibrant Nyali lifestyle while enjoying a relaxing retreat in this charming studio apartment. Your unforgettable getaway awaits!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mb-2 flex gap-3 empty:hidden -ml-2\">\r\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\r\n<div class=\"flex items-center\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"></button>\r\n<div class=\"flex items-center pb-0\"><span class=\"overflow-hidden text-clip whitespace-nowrap text-sm\">4o mini</span></div>\r\n</div>\r\n</div>\r\n</div>',425,425,18,'Bustani Apartments, along Links Road.','-4.0304400','39.7153910',15,1,'422,429,428,427,426,425,',NULL,NULL,3500.00,2800.00,NULL,0,0,2,2,1,30,1,'[{\"name\":\"Air Conditioning\",\"price\":\"500\",\"type\":\"one_time\"}]',NULL,'publish',1,9,9,NULL,'2024-10-02 09:30:34','2024-10-02 09:33:23',NULL,NULL,NULL,NULL,NULL,9,NULL,2),
