(22,'Beachfront Apartment at Nyali','beachfront-apartments-at-nyali','<div class=\"flex max-w-full flex-col flex-grow\">\r\n<div class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\r\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert dark\">\r\n<p>Welcome to your paradise retreat at our stunning 3-bedroom beachfront apartment in Nyali! This spacious and elegantly designed apartment offers breathtaking ocean views and direct access to the sandy shores. With three beautifully appointed bedrooms, it comfortably accommodates families or groups seeking relaxation and adventure. Enjoy the open-concept living and dining area that seamlessly flows to a private balcony, perfect for sunset views.</p>\r\n<p>The apartment features a modern kitchen equipped with everything you need for home-cooked meals. Step outside to discover a sparkling swimming pool surrounded by lush gardens, ideal for sunbathing or enjoying a refreshing dip. Located just moments from local attractions, dining, and shopping, this beachfront haven is the perfect blend of comfort and convenience. Experience the ultimate coastal lifestyle at this Nyali gem!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mb-2 flex gap-3 empty:hidden -ml-2\">\r\n<div class=\"items-center justify-start rounded-xl p-1 flex\">\r\n<div class=\"flex items-center\"><button class=\"rounded-lg text-token-text-secondary hover:bg-token-main-surface-secondary\"></button>\r\n<div class=\"flex items-center pb-0\"><span class=\"overflow-hidden text-clip whitespace-nowrap text-sm\">4o mini</span></div>\r\n</div>\r\n</div>\r\n</div>',444,NULL,18,'Along 3rd Avenue, Links Rd Nyali','-4.017894615699203','39.7280992477871',15,1,'460,450,451,453,446,457,449,447,452,461,458,456,448,445,455,459,454,',NULL,'[{\"title\":\"Check-in time?\",\"content\":\"As a rough guide, the check-in time is after 12pm. Let us know your arrival time in case you schedule and early check in we\\u2018ll do our best to have your room available.\"},{\"title\":\"Check-out time?\",\"content\":\"As a rough guide, the check-out time is before 11am. If you plan a late check out kindly let us know your departure time, we\\u2019ll our best to satisfy your needs.\"},{\"title\":\"Can I leave my luggage?\",\"content\":\"Yes, we can look after your luggage. If at check in your room is not ready yet or in case of early check out after .We will store your luggage free of charge on your check-in and check-out days.\"},{\"title\":\"Is there WIFI?\",\"content\":\"A wireless internet connection is available throughout the villa. The guest rooms feature hi-speed web connectivity (both wireless and cabled).\"},{\"title\":\"Can I bring my pet?\",\"content\":\"This property does not allow guests with pets.\"}]',15000.00,13500.00,NULL,0,0,6,3,2,100,NULL,NULL,NULL,'publish',1,9,9,NULL,'2024-10-02 10:49:37','2024-10-02 10:51:26',NULL,NULL,NULL,NULL,NULL,9,NULL,NULL),
(23,'Luxury Apartment at Kileleshwa','luxury-apartment-at-kileleshwa','<p>Welcome to your cozy retreat in Kileleshwa, Nairobi! This fully furnished one-bedroom apartment is designed for comfort and convenience, featuring a charming balcony where you can relax and enjoy the fresh air. Enjoy modern amenities, including a hot shower for those refreshing moments after a long day.</p>\r\n<p>This spacious house features a well-equipped kitchen, perfect for culinary enthusiasts and family gatherings. Enjoy movie nights on the smart TV and stay connected with high-speed Wi-Fi throughout the property.</p>\r\n<p>With self check-in for hassle-free access, this apartment allows you to come and go as you please. Stay active in the functional gym on-site, perfect for maintaining your fitness routine. Located just moments away from a variety of beautiful malls, you\'ll have easy access to shopping, dining, and entertainment options. Whether you&rsquo;re here for business or leisure, this Kileleshwa gem is the ideal home away from home!</p>\r\n<div class=\"flex max-w-full flex-col flex-grow\">\r\n<div class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\r\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert dark\">\r\n<p>For added convenience, the house includes a lift, making accessibility a breeze. Ample parking ensures you and your guests have plenty of space, while 24/7 security provides peace of mind for a safe and comfortable living experience. Whether you\'re entertaining or relaxing, this home offers everything you need for modern living. Experience comfort and convenience all in one place!</p>\r\n<div class=\"flex max-w-full flex-col flex-grow\">\r\n<div class=\"min-h-8 text-message flex w-full flex-col items-end gap-2 whitespace-normal break-words [.text-message+&amp;]:mt-5\">\r\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert dark\">\r\n<h3><strong>Cancellation Policy</strong></h3>\r\n<p>We want you to feel secure in your booking! Our moderate cancellation policy allows for a full refund if you cancel your reservation up to 5 days before your check-in date.</p>\r\n<p>Please note that cancellations made within 5 days of check-in will not be eligible for a refund. We encourage you to plan accordingly and reach out if you have any questions about your reservation. Thank you for understanding, and we look forward to welcoming you!</p>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<h3><strong>Apartment Guidelines for a Comfortable Stay</strong></h3>\r\n<p>Welcome to your home away from home! To ensure a pleasant experience for everyone, please adhere to the following guidelines:</p>\r\n<ol>\r\n<li>\r\n<p><strong>Responsibility for Damages</strong>: If any valuable items in the apartment are found missing or broken during or after your stay, you will be responsible for covering the replacement costs.</p>\r\n</li>\r\n<li>\r\n<p><strong>No Smoking</strong>: Smoking is not permitted in the apartment. Please respect this rule for the comfort of all guests.</p>\r\n</li>\r\n<li>\r\n<p><strong>Lost Keys</strong>: In the event of lost apartment keys, a replacement fee of 5,000 KES will be charged.</p>\r\n</li>\r\n<li>\r\n<p><strong>Respect the Stay</strong>: Treat the apartment as if it were your own. Your consideration contributes to a welcoming environment.</p>\r\n</li>\r\n<li>\r\n<p><strong>Neighborly Conduct</strong>: Use common sense and be respectful to your neighbors. A peaceful atmosphere benefits everyone.</p>\r\n</li>\r\n<li>\r\n<p><strong>Trash Disposal</strong>: Please take all trash to the trash room located next to the guard room before checking out.</p>\r\n</li>\r\n<li>\r\n<p><strong>Electricity for Long-Term Stays</strong>: For stays longer than one month, guests are responsible for recharging electricity and purchasing tokens as needed.</p>\r\n</li>\r\n<li>\r\n<p><strong>Shoe Cleaning</strong>: A brush is provided for wiping or cleaning shoes. Please refrain from using towels for this purpose.</p>\r\n</li>\r\n<li>\r\n<p><strong>Open Communication</strong>: If anything arises that we should know about, feel free to come and share. You are also welcome to ask us any questions or seek assistance during your stay.</p>\r\n</li>\r\n</ol>\r\n<p>Thank you for your cooperation and enjoy your stay!</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Gallery</strong></p>\r\n<p>Living Room</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"/uploads/0000/9/2024/10/03/living-room-6.jpeg\" alt=\"Living Room\" width=\"251\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/living-room-4.jpeg\" alt=\"Living Room\" width=\"251\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/living-room-2.jpeg\" alt=\"\" width=\"251\" height=\"445\" /></p>\r\n<p>Kitchen</p>\r\n<p><img src=\"/uploads/0000/9/2024/10/03/kitchen.png\" alt=\"Kitchen\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/kitchen-2.png\" alt=\"Kitchen\" width=\"267\" height=\"445\" /></p>\r\n<p>Bedroom</p>\r\n<p><img src=\"/uploads/0000/9/2024/10/03/bedroom.png\" alt=\"Bedroom\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/bedroom-2.png\" alt=\"Bedroom\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/bedroom-3.png\" alt=\"\" width=\"267\" height=\"445\" /></p>\r\n<p>Washroom</p>\r\n<p><img src=\"/uploads/0000/9/2024/10/03/washroom.png\" alt=\"Washroom\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/washroom-2.png\" alt=\"Washroom\" width=\"267\" height=\"445\" /></p>\r\n<p>Functional Gym</p>\r\n<p><img src=\"/uploads/0000/9/2024/10/03/gym-2.png\" alt=\"Gym\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/gym-3.png\" alt=\"Gym\" width=\"267\" height=\"445\" /></p>\r\n<p>Exterior</p>\r\n<p><img src=\"/uploads/0000/9/2024/10/03/exterior.png\" alt=\"Exterior View\" width=\"267\" height=\"445\" /><img src=\"/uploads/0000/9/2024/10/03/exterior-3.png\" alt=\"Night Exterior View\" width=\"267\" height=\"445\" /></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',491,491,21,'At Gatundu Heights along Gatundu Close, Kileleshwa Nairobi.','-1.2803562891794589','36.782643025230065',18,1,'497,495,489,485,490,488,492,484,486,493,498,494,491,487,496,',NULL,'[{\"title\":\"Check-in time?\",\"content\":\"Our standard check-in time is after 12pm. If you plan to arrive earlier, please let us know your expected arrival time. We\\u2019ll do our best to accommodate your request for an early check-in and have your room ready for you. Your comfort is our priority, and we look forward to welcoming you!\"},{\"title\":\"Check-out time?\",\"content\":\"Check-out time is before 10am. If you anticipate needing a late check-out, please let us know your departure time. We\\u2019ll do our best to accommodate your request and ensure your needs are met. Thank you for your understanding, and we hope you have a wonderful stay!\"},{\"title\":\"Internet Access?\",\"content\":\"Enjoy seamless connectivity during your stay! A wireless internet connection is available throughout the property, and the bedroom features high-speed web access, wirelessly.. Stay connected for work or leisure with ease!\"}]',8000.00,7200.00,NULL,0,0,2,1,1,95,NULL,NULL,NULL,'publish',1,9,9,NULL,'2024-10-03 10:28:27','2024-10-03 13:26:50',NULL,NULL,NULL,NULL,NULL,9,NULL,NULL);
