(44,'user_content_email_registered','user','<h1 style=\"text-align: center;\"><img src=\"/uploads/0000/9/2024/09/23/harmo-stays.png\" alt=\"\" width=\"115\" height=\"115\" /></h1>\r\n<h1 style=\"text-align: center;\">Welcome to Harmo Stays</h1>\r\n<h3>Greetings [last_name]!</h3>\r\n<p>&nbsp;</p>\r\n<p>Your adventure is just a few clicks away. Whether you\'re booking a stay in Nyali, renting a car to explore Bamburi, or planning a tour of Wasini Island, we\'re here to make your trip effortless and unforgettable.</p>\r\n<p>Regards,</p>\r\n<p>Harmo Stays.</p>',NULL,6,6,NULL,NULL,'2024-10-02 23:09:29'),
