(91,'news_sidebar','news','{\"1\":{\"title\":\"About Us\",\"content\":\"At Harmo Stays, we specialize in crafting unforgettable, adrenaline-pumping experiences along the stunning Kenyan coast. Our passionate team is dedicated to connecting travelers with the region\'s most thrilling tours, from snorkeling in vibrant coral reefs to kite surfing on the breathtaking Diani Beach. We pride ourselves on offering personalized itineraries that cater to every adventurer\'s desires, ensuring that each journey is unique and exhilarating. Whether you\'re seeking wildlife encounters, cultural immersions, or extreme sports, Harmo Stays is your ultimate partner in discovering the wild side of Kenya\'s beautiful coastline. Let the adventure begin!\",\"type\":\"content_text\"},\"2\":{\"title\":\"Recent News\",\"content\":null,\"type\":\"recent_news\"},\"3\":{\"title\":\"Categories\",\"content\":null,\"type\":\"category\"},\"4\":{\"title\":\"Tags\",\"content\":null,\"type\":\"tag\"}}',NULL,9,9,NULL,NULL,'2024-10-03 14:11:07'),
